package main

import "fmt"

func updateMatrix(matrix [][]int) [][]int {
	width, length := len(matrix), len(matrix[0])
	result := make([][]int, width)

	for i := range result {
		result[i] = make([]int, length)
	}

	for i := 0; i < width; i++ {
		for j := 0; j < length; j++ {
			if matrix[i][j] == 0 {
				result[i][j] = 0
			} else {
				result[i][j] = 1<<31 - 1
			}
		}
	}

	for i := 0; i < width; i++ {
		for j := 0; j < length; j++ {
			if i > 0 {
				result[i][j] = Min(result[i][j], result[i-1][j]+1)
			}
			if j > 0 {
				result[i][j] = Min(result[i][j], result[i][j-1]+1)
			}
		}
	}

	for i := width - 1; i >= 0; i-- {
		for j := length - 1; j >= 0; j-- {
			if i < width-1 {
				result[i][j] = Min(result[i][j], result[i+1][j]+1)
			}
			if j < length-1 {
				result[i][j] = Min(result[i][j], result[i][j+1]+1)
			}
		}
	}
	return result
}

func Min(a, b int) int {
	if a < b {
		return a
	}
	return b
}

